import { createAction, createRequestTypes, createActionsFromTypes } from './helpers';


export const GUEST_LOG_IN = 'GUEST_LOG_IN';
export const guestLogIn = createAction(GUEST_LOG_IN);

export const GUEST_LOG_OUT = createRequestTypes('GUEST_LOG_OUT');
export const guestlogOut = createActionsFromTypes(GUEST_LOG_OUT);
